import styled from "styled-components";

export const ContainerFooter = styled.footer`
    text-align: center;
    border-top: 1px solid rgba(0, 0, 0, 0.1);
    padding: 15px;
    height: 50px;
    color: black;

    a {
        color: #9;
    }
`;
